Uint8List? parseUint8List(String? input) {
  if (input == null || input.isEmpty) return null;

  try {
    final cleaned = input
        .replaceAll('[', '')
        .replaceAll(']', '')
        .split(',')
        .map((s) => int.parse(s.trim()))
        .toList();
    return Uint8List.fromList(cleaned);
  } catch (e) {
    print("Error parsing Uint8List: $e");
    return null;
  }
}

