class _SettingsPageState extends State<SettingsPage> {
  bool _showThemeOptions = false;

  Future<void> _openDocs() async {
    final uri = Uri.parse(
        'https://docs.google.com/document/d/1_YMfO3SsNhgeyioCx32rlcKOw77nXHue/edit?usp=sharing'
    );
    if (!await launchUrl(uri, mode: LaunchMode.externalApplication)) {
      ScaffoldMessenger.of(context).showSnackBar(
          SnackBar(content: Text('Could not open documentation.'))
      );
    }
  }


  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(title: const Text("Settings")),

      floatingActionButton: FloatingActionButton.extended(
        icon: const Icon(Icons.description),
        label: const Text('Documentation'),
        onPressed: _openDocs,
      ),


      body: Consumer2<ThemeProvider, Usser>(
        builder: (context, themeProvider, usser, child) {
          return Stack(
            children: [
              // Top-left currency display
              Positioned(
                top: 16,
                left: 16,
                child: Row(
                  children: [
                    const Icon(Icons.monetization_on, color: Colors.amber),
                    const SizedBox(width: 4),
                    Text(
                      usser.currancyTotal.toString(),
                      style: const TextStyle(
                          fontSize: 18, fontWeight: FontWeight.bold),
                    ),
                  ],
                ),
              ),


              Positioned(
                top : 16,
                right : 16,
                child: ElevatedButton(
                  onPressed: () {
                    Navigator.of(context).pushNamedAndRemoveUntil('/login', (route) => false);
                  },
                  child: Text('Logout'),
                ),
              ),



              // Center content
              Center(
                child: Padding(
                  padding: const EdgeInsets.symmetric(horizontal: 16.0),
                  child: Column(
                    mainAxisSize: MainAxisSize.min,
                    children: [
                      Text(usser.usserName, style: Theme
                          .of(context)
                          .textTheme
                          .headlineSmall),
                      const SizedBox(height: 16),
                      ProfilePhotoWidget(
                        initialImage: usser.profilePic != null
                            ? parseUint8List(usser.profilePic!)
                            : placeHolderImage,
                      ),
                      const SizedBox(height: 16),
                      Text(usser.email, style: Theme
                          .of(context)
                          .textTheme
                          .bodyLarge),
                      const SizedBox(height: 32),
                      ElevatedButton(
                        onPressed: () {
                          setState(() {
                            _showThemeOptions = !_showThemeOptions;
                          });
                        },
                        child: const Text("Themes"),
                      ),
                      if (_showThemeOptions) ...[
                        const SizedBox(height: 16),
                        ListTile(
                          title: const Text("Current Theme"),
                          subtitle: Text(themeProvider.themeType
                              .toString()
                              .split('.')
                              .last
                              .toUpperCase()),
                        ),
                        _themeRadio(
                            ThemeType.light, "Light Theme", themeProvider),
                        _themeRadio(
                            ThemeType.dark, "Dark Theme", themeProvider),
                        _themeRadio(
                            ThemeType.custom, "Custom Theme", themeProvider),
                        if (themeProvider.themeType ==
                            ThemeType.custom) ..._customColorPickers(
                            themeProvider),
                      ],
                    ],
                  ),
                ),
              ),
            ],
          );
        },
      ),
    );
  }

  RadioListTile<ThemeType> _themeRadio(ThemeType type, String label,
      ThemeProvider provider) {
    return RadioListTile<ThemeType>(
      title: Text(label),
      value: type,
      groupValue: provider.themeType,
      onChanged: (value) {
        if (value != null) provider.setTheme(value);
      },
    );
  }

  List<Widget> _customColorPickers(ThemeProvider provider) {
    return [
      ListTile(
        title: const Text('Surface Color'),
        trailing: CircleAvatar(
            backgroundColor: provider.currentTheme.colorScheme.surface),
        onTap: () async {
          final Color? newColor = await _showColorPicker(
              context, provider.currentTheme.colorScheme.surface);
          if (newColor != null) {
            provider.setCustomTheme(
              surfaceColor: newColor,
              onSurfaceColor: provider.currentTheme.colorScheme.onSurface,
            );
          }
        },
      ),
      ListTile(
        title: const Text('Text Color'),
        trailing: CircleAvatar(
            backgroundColor: provider.currentTheme.colorScheme.onSurface),
        onTap: () async {
          final Color? newColor = await _showColorPicker(
              context, provider.currentTheme.colorScheme.onSurface);
          if (newColor != null) {
            provider.setCustomTheme(
              surfaceColor: provider.currentTheme.colorScheme.surface,
              onSurfaceColor: newColor,
            );
          }
        },
      ),
    ];
  }

  Future<Color?> _showColorPicker(BuildContext context,
      Color currentColor) async {
    Color selectedColor = currentColor;
    return showDialog<Color>(
      context: context,
      builder: (context) =>
          AlertDialog(
            title: const Text('Pick a color'),
            content: SingleChildScrollView(
              child: ColorPicker(
                pickerColor: selectedColor,
                onColorChanged: (Color color) {
                  selectedColor = color;
                },
                pickerAreaHeightPercent: 0.8,
              ),
            ),
            actions: [
              TextButton(onPressed: () => Navigator.of(context).pop(),
                  child: const Text('Cancel')),
              TextButton(
                  onPressed: () => Navigator.of(context).pop(selectedColor),
                  child: const Text('OK')),
            ],
          ),
    );
  }
}
